query relaySessionsByUserIdQuery(
  $userId: ID!
) {
  sessionsByUserId(input: {userId: $userId}) {
    edges {
      node {
        id
        subGameSession {
          id
          isActive
        }
        twitchSession {
          gameName
          thumbnailURL
          user {
            id
            username
          }
          viewerCount
        }
      }
    }
  }
}

db54de61900f6f1f8da29d8acd2a3128:
query relaySubGameSessionByUserIdQuery(
  $userId: ID!
) {
  activeSubGameSessionByUserId(input: {userId: $userId}) {
    subGameSession {
      id
      isSubOnly
      maxActivePlayers
    }
  }
}
